2.html','2015-07-02 05:37:01','2015-07-02 05:40:34','[Physics/Math/Science]--Physics--Astronomy Picture of the Day','Venus and Jupiter are Close','#related\nhttp://apod.nasa.gov/apod/image/1507/VenusandJupiterareClose_WangLetian1024.jpg\n\n#Composite Image Credit & Copyright: Wang, Letian\n#Explanation: On June 30, Venus and Jupiter were close in western skies at dusk. Near the culmination of this year\'s gorgeous conjunction, the two bright evening planets are captured in the same telescopic field of view in this image taken after sunset from Bejing, China. As the two bright planets set together in the west, a nearly Full Moon rose above the horizon to the south and east. Imaged that night with the same telescope and camera, the rising Moon from the opposite part of the sky is compared with the planetary conjunction for scale in the digitally composited image. The full lunar disk covers an angle of about 1/2 degree on the sky. Visible as well in binoculars and small telescopes are Venus\' crescent and Jupiter\'s four Galilean moons. Of course, Venus and Jupiter are still close.','ÏôºÏ™Ω ÏúÑÍ∞Ä Î™©ÏÑ±, ÏïÑÎûòÍ∞Ä Í∏àÏÑ±, Ïò§ÎäòÏ™ΩÏù¥ Îã¨ Ïù∏ÎìØ.','10.0/10',0,0,0),(100000000,'http://apod.nasa.gov/apod/astropix.html','2015-05-02 03:45:30','2015-05-02 03:45:30','[Physics/Math/Science]--News','Astronomy Picture of the Day','Discover the cosmos! Each day a different image or photograph of our fascinating universe is featured, along with a brief explanation written by a professional astronomer.','NASA ÏóêÏÑú Ïö¥ÏòÅÌïòÎäî ÏÇ¨Ïù¥Ìä∏. Îß§Ïùº Ïö∞Ï£ºÍ¥ÄÎ†®, Í≥ºÌïôÍ¥ÄÎ†® ÏÇ¨ÏßÑÏùÑ ÏóÖÎ°úÎìú Ìï®.\nÏÇ¨Ïù¥Ìä∏Í∞Ä css Ï†ÅÏúºÎ°ú Ï¢Ä Îçú Íæ∏Î©∞Ï†∏ÏûàÎäîÍ≤å ÏïÑÏâΩ.','4.5/5',0,0,0),(100000000,'http://appsurprise.co.kr/','2015-05-04 08:37:22','2015-05-04 08:38:28','[IT/Programming]--App','App Surprise Ïç®ÌîÑÎùºÏù¥Ï¶à','Í∞ÅÏ¢Ö ÏÑ∏Ïùº Ï†ïÎ≥¥Îì§ (ÏùòÎ•ò, ÌôîÏû•Ìíà, ÏùåÏãù Îì±) ÏùÑ Ïûò Ï†ïÎ¶¨Ìï¥ÏÑú Î≥¥Ïó¨Ï£ºÎäî ÏÇ¨Ïù¥Ìä∏.','ÌïôÍµê ÌõÑÎ∞∞Í∞Ä Ï∞ΩÏóÖÌï¥ÏÑú ÎßåÎì† ÏÑúÎπÑÏä§. ÏôÑÏ†Ñ ÍπîÎÅîÌïòÍ≤å Ï