induced by the interfacial Dzyaloshinskii‚ÄìMoriya interaction','Soliton-like magnetic domain wall motion induced by the interfacial Dzyaloshinskii‚ÄìMoriya interaction\n\nYoko Yoshimura,	Kab-Jin Kim,	Takuya Taniguchi,	Takayuki Tono,	Kohei Ueda,	Ryo Hiramatsu,	Takahiro Moriyama,	Keisuke Yamada,	Yoshinobu Nakatani	& Teruo Ono\n\nTopological defects such as magnetic solitons, vortices and skyrmions have started to play an important role in modern magnetism because of their extraordinary stability1, which can be exploited in the production of memory devices. Recently, a type of antisymmetric exchange interaction, namely the Dzyaloshinskii‚ÄìMoriya interaction (DMI; refs 2,3), has been uncovered and found to influence the formation of topological defects4, 5, 6, 7. Exploring how the DMI affects the dynamics of topological defects is therefore an important task. Here we investigate the dynamics of the magnetic domain wall (DW) under a DMI by developing a real time DW detection scheme. For a weak DMI, the DW velocity increases with the external field and reaches a peak velocity at a threshold field, beyond which it abruptly decreases. For a strong DMI, on the other hand, the velocity reduction is completely suppressed and the peak velocity is maintained constant even far above the threshold field. Such a distinct trend of the velocity can be explained in terms of a magnetic soliton, the topology of which is protected during its motion. Our results therefore shed light on the physics of dynamic topological defects, which paves the way for future work in topology-based memory applications.','',NULL,0,0,0),(100000000,'http://www.naturenscience.co.kr/','2015-05-09 06:33:26','2016-06-01 08:11:27','[Physics/Math/Science]--Open Course Ware','Nature n Science .co.kr','','',NULL,0,0,0),(100000000,'http://www.nytimes.com/2015/05/10/nyregion/manicurists-in-new-york-area-are-underpaid-and-unprotected.html?_r=0','2015-05-09 02:23:12','2015-05-09 02:23:12','[Ï†ïÏπò/ÏÇ¨Ìöå/Í≤ΩÏ†ú]--ÏÇ¨Ì