g about.\n\n#History\nWe started in 2007 wanting to build something new for online communities. Our founders, Daniel Ha and Jason Yan, met in 7th grade but didn‚Äôt start working on Disqus until a few years later at UC Davis (right before dropping out).\n\n#Philosophy\nWe believe that how you say something is just as important as what you say. You don‚Äôt need to trade in your identity for the ability to speak up. The freedom to express how you want is what lets you be truly authentic.\n\n#Motivation\nDisqus is made for geeks by geeks. Everyone is a geek about something, whether it‚Äôs music, food, or science fiction. Sometimes you just need the right space to explore it. Whatever you‚Äôre into, we help you get into it.\n\n#The_Missing_Link\nDiscussion and community were among the first great promises of the Internet. But before Disqus, they were neglected by the revolution in other forms of communications. So we built the leading company in a category that, in some ways, we invented. And quietly, made having an online discussion a better experience.\n\n#A_Good_Discussion_is_Great_to_Find\nWhen you visit one of the millions of sites using Disqus, you‚Äôre in a connected community, fundamentally different from a traditional destination social network. When you‚Äôre on a site using Disqus, you‚Äôre exploring a personal passion and in an optimal place to discover new ideas, new people and new stories that you couldn‚Äôt find anywhere else.\n\n#Comments_Count\nWith Disqus, publishers experience a more engaged audience that spends more time on site and consumes more content. They grow their audience by being part of a content discovery loop across the Disqus network. They can turn on a new revenue stream through native advertising. Comments no longer cost, they count.\n\n#People_Just_Want_to_Be_Heard\nToday, we represent, in our one billion monthly visitors and over 40 languages, a vital part of the way the world communicates. People no longer just want to read or share 