sky.','','10.0/10',0,0,0),(100000043,'https://apod.nasa.gov/apod/image/2108/m74_APOD1024.jpg','2021-08-19 11:59:56','2021-08-19 11:59:56','[Music/Break]--Image test','A Perfect Spiral','#related\nhttps://apod.nasa.gov/apod/ap210813.html\n\n#Image Credit: NASA, ESA, Hubble, HLA; Processing: Mehmet Hakan Ozsarac\n#Explanation: If not perfect then this spiral galaxy is at least one of the most photogenic. An island universe of about 100 billion stars, 32 million light-years away toward the constellation Pisces, M74 presents a gorgeous face-on view. Classified as an Sc galaxy, the grand design of M74\'s graceful spiral arms are traced by bright blue star clusters and dark cosmic dust lanes. This sharp composite was constructed from image data recorded by the Hubble Space Telescope\'s Advanced Camera for Surveys. Spanning about 30,000 light-years across the face of M74, it includes exposures recording emission from hydrogen atoms, highlighting the reddish glow of the galaxy\'s large star-forming regions. With a lower surface brightness than most galaxies in the Messier catalog, M74 is sometimes known as the Phantom Galaxy.','','10.0/10',0,0,0),(100000043,'https://i.imgur.com/r3RMdYs.gif','2021-08-25 02:40:23','2021-08-25 02:40:23','[Music/Break]--Image test','ÎÇ®Í∑úÎ¶¨ ÎßåÎëê','','','10.0/10',0,0,0),(100000043,'https://tv.kakao.com/v/421688114','2021-08-23 06:26:11','2021-08-23 08:02:58','[Music/Break]--Video test','ÎçîÎ≥¥Ïù¥Ï¶à - Ïä§Î¶¥ ÎùºÏù¥Îìú (THE BOYZ - THRILL RIDE), MBC 210821 Î∞©ÏÜ°','','tv.kakao.com and entertain.daum.net','8.2/10',0,0,0),(100000043,'https://tv.naver.com/v/3081353','2021-08-19 07:24:39','2021-08-23 06:17:56','[Music/Break]--Video test','ÎåÄÎãµ ÏûêÌåêÍ∏∞(?) Ï°∞ÏÑ∏Ìò∏Ïùò Ìï©Î•ò! \'Î¨¥ÌïúÎèÑÏ†ÑÏóê ÌÅ∞ ÎèÑÏõÄ\'','','ÎÑ§Ïù¥Î≤Ñ tv','9.0/10',0,0,0),(100000043,'https://vertx.io/docs/vertx-mail-client/java/','2021-05-14 00:40:47','2021-05-14 00:40:47','Recoeve.net--Í∞úÎ∞ú','Vert.x Mail client (SMTP client implementation)','','','7.0/10',0,0,0),(100000043